import { Link } from "react-router-dom";
import "/Main"
function Main(){
return(
<div class="entire">
    <div class="head">
        <div class="img">
            <h1>LOGIN FORM</h1>
        </div>
        </div>
        <div class="details">
        <form class="User-need">
        <Link to="/user"><button type="onClick" name="view" id="view" ></button></Link>
        <Link to="/login"> <button type="onClick" name="Add" id="Add"></button></Link>
        <Link to="/edit-user/:id"> <button type="onClick" name="Update" id="Update"></button></Link>
        </form>
 </div>
</div>
);
}
export default Main;
